const Props3 = () => {
    const userList = [
        {id:1,name:"村人A"},
        {id:2,name:"村人B"},
        {id:3,name:"街人A"},
        {id:4,name:"街人B"},
        {id:5,name:"街人C"}
    ];

    return (
        <div>
            {userList.map((user) => 
                <UserElement 
                    UserID={user.id} 
                    UserName={user.name} 
                />
            )}
        </div>
    )
}

const UserElement = (props: {UserID:number, UserName:string}) =>{
     const {UserID,UserName} = props
    

    return <div> ID:{UserID} Name:{UserName}</div>
}

export default Props3
